Dashmix.onLoad((() => class { 
    static sweetAlert2() { 
        let e = Swal.mixin({ 
            buttonsStyling: !1, 
            target: "#page-container", 
            customClass: { 
                confirmButton: "btn btn-success m-1", 
                cancelButton: "btn btn-danger m-1", 
                input: "form-control" 
            } 
        }); 
        document.querySelector(".js-swal-confirm").addEventListener("click", (t => { 
            e.fire({ 
                title: "Anda yakin?", 
                text: "Anda tidak akan dapat memulihkan tindakan ini!", 
                icon: "warning", 
                showCancelButton: !0, 
                customClass: { 
                    confirmButton: "btn btn-danger m-1", 
                    cancelButton: "btn btn-secondary m-1" 
                }, 
                cancelButtonText: "Batal",
                confirmButtonText: "Ya, hapus!", 
                html: !1, 
                preConfirm: e => new Promise((e => { 
                    setTimeout((() => { 
                        e() 
                    }), 
                    50) 
                })) 
            }).then((t => { 
                t.value ? e.fire("Dihapus!", "Data berhasil dihapus!", "success") : "cancel" === t.dismiss && e.fire("Dibatalkan", "Berhasil dibatalkan!", "error") 
            })) 
        }))
    } 
    static init() { 
        this.sweetAlert2() 
    } 
}.init()));